import { createMuiTheme } from "@material-ui/core";

export const darkTheme = createMuiTheme({
  palette: {
    type: "dark",
    primary: {
      main: "#263238"
    },
    secondary: {
        main: '#bdbdbd'
    },
    aboutDrawer: {
      main: '#263238'
    },
    textPrimary: {
      main: '#fafafa'
    },
    backgroundMainPage: {
      main: 'rgb(26, 44, 81) -10px -10px 16px 0px, rgb(22, 28, 60) 10px 10px 16px 0px, rgb(26, 44, 81) 2px 2px 4px 0px inset, rgb(22, 28, 60) -2px -2px 4px 0px inset'
    }
  }
});
